%[text] - Folder of Images
%[text] - Split channels, build channels
%[text] - Add scale bar to last image
%[text] - Use um per pixel to measure objects in image
%[text] - Multidimensional images
%[text] - Display 2 Channel Images correctly
%[text] - Use colorThresholder to create a segmentation function
%[text] - Use imageSegmenter to use SAM
%[text] - Use imageSegmenter to prototype imopen/imclose
%[text] - Texture Filters
%[text] - Save as an HTML
%[text] - Create a function?
%[text] - Save Figures as PNG files for Upload \
%[text] 
%%
%[text] ## Load Image and Display
%[text] - Correct bit-depth to display the image properly - Normalize each channel
%[text] - Rotate Image 90Ëš using imrotate
%[text] - Display the image \
folder_name = "/Users/ernesto/MATLAB-Drive/MtMdata/unit2/MOB_VGLUT2"; %[control:filebrowser:2b95]{"position":[15,69]}
file_name = '17 B L vglut2 omp.jp2';
img = imread(fullfile(folder_name,file_name));
%%
%[text] ### Inspect Image
figure;
mmShowHist(img)
max(img(:))
%[text] - 12-bit image \
%[text] 
%%
%[text] ### Normalize each Channel
%[text] Use a FOR LOOP
imgn = zeros(size(img),'single'); % preallocate
for n=1:3
    imgn(:,:,n) = mat2gray(img(:,:,n)); % Store each channel in the new image array
end
%%
%[text] ## Display Image
%[text] ![](text:image:19d0)
figure;
imgr = imrotate(imgn,90); % rotate 90
imshow(imgr)
%%
hl = mmAddScaleBar(gca,250,2.3,'w');
text(40,50,'A',Color='white',FontSize = 16, FontWeight='bold')
%%
%[text] ### Enhance image even further
%[text] And now that we have the x and positions of the scale bar, we can just input those into the function
lowhigh = stretchlim(imgn);
imga = imadjust(imgn,lowhigh);
imgr = imrotate(imga,90); % rotate 90

figure;
imshow(imgr)
text(40,50,'A',Color='white',FontSize = 16, FontWeight='bold')
mmAddScaleBar(gca,250,2.3,'w',2,[74.6, 1195.4]); % set scale bar position
%%
%[text] ## Display a Folder of Images
%[text] ### Set folder name
folder_name = "/Users/ernesto/MATLAB-Drive/MtMdata/unit2/MOB_VGLUT2"; %[control:filebrowser:68fc]{"position":[15,69]}
%%
%[text] ### Useful MATLAB app
imageBrowser(folder_name)
%%
%[text] ### Get info about files
%[text] The trick here is to include the .jp2 extension
contents = dir(fullfile(folder_name,"*.jp2"))
%[text] - 25 files found \
%%
contents(1).folder
contents(1).name
fullfile(contents(1).folder,contents(1).name)
%%
%[text] ### Load the first 6 images
figure
tiledlayout("flow","TileSpacing","none","Padding","tight")
az='A':'Z'; % preallocate labels
for n=1:6 % six iterations
    img = imread(fullfile(contents(n).folder,contents(n).name)); % create file path
    imgn = mat2gray(img); % Normalize the current image to the range [0, 1]
    imgr = imrotate(imgn,90); % rotate image
    ax(n) = nexttile;
    imshow(imgr)
    text(40,50,az(n),Color='white',FontSize = 16, FontWeight='bold')
end
mmAddScaleBar(gca,250,2.3,'w',2,[63, 1210.0]); % add scale bar to last panel
%%
%[text] ## Segment Leaf
mmSetUnitDataFolder(2); % in unit2 folder %[output:2d5a52c2]
rgb = imread("leaf.png");
%%
colorThresholder(rgb)
%[text] - Capture Green using labe space
%[text] - add mask to workspace \
%%
%[text] Show the result
mask = imfill(mask,'holes');
figure
mmShowBurnImage(rgb,mask)

%%
%[text] ### Capture the whole leaf
imageSegmenter(rgb)
%%
img = im2gray(rgb); % convert to grayscale
imshow(img) %[output:2db43e4c]
%%
imgc = imcomplement(img); % invert
imshow(imgc) %[output:01826988]
%%
imageSegmenter(imgc);
%%
mmShowBurnImage(rgb,maskAll,"color","green")
