%[text] - Save Image as png
%[text] - Save livescript as HTML \
%%
%[text] ### Skittles
rgb = imread('/Users/ernesto/Documents/MATLAB/teaching resources/I&M/Unit 2/MATLAB Grader/skittles.png');
%%
colorThresholder(rgb)
%%
mask = getYellowSkittles(rgb);
mask = bwareaopen(mask,50);
mask = imfill(mask,'holes');
mask = mmGetWatershed(mask,5);
figure;
mmShowBurnImage(rgb,mask,"color",'c')
%%
imageSegmenter(single(mask))
%%
imageSegmenter(rgb)
%%
function mask = getYellowSkittles(RGB)

% Auto-generated by colorThresholder app on 06-Oct-2025
%------------------------------------------------------


% Convert RGB image to chosen color space
I = rgb2lab(RGB);

% Define thresholds for channel 1 based on histogram settings
channel1Min = 74.994;
channel1Max = 95.621;

% Define thresholds for channel 2 based on histogram settings
channel2Min = -12.334;
channel2Max = 6.951;

% Define thresholds for channel 3 based on histogram settings
channel3Min = 22.588;
channel3Max = 89.305;

% Create mask based on chosen histogram thresholds
sliderBW = (I(:,:,1) >= channel1Min ) & (I(:,:,1) <= channel1Max) & ...
    (I(:,:,2) >= channel2Min ) & (I(:,:,2) <= channel2Max) & ...
    (I(:,:,3) >= channel3Min ) & (I(:,:,3) <= channel3Max);
mask = sliderBW;

end


